import './App.css';
import axios from 'axios';
import React, { useState, useEffect } from 'react';
import {
  MDBTable,
  MDBTableHead,
  MDBTableBody,
  MDBRow,
  MDBCol,
  MDBContainer,
  MDBModalBody,
  MDBBtn
} from "mdb-react-ui-kit";

function App() {
  const [data, setData] = useState([]);
  const [value, setValue] = useState("");

  useEffect(() => {
    loadUserData();
  }, []);

  const loadUserData = async () => {
    return await axios
      .get("http://localhost:5000/users")
      .then((response) => setData(response.data))
      .catch((err) => console.log(err));
  }

  const handleReset = async(e) => {
    loadUserData();
  };

  const handleSearch = async(e) => {
    e.preventDefault();
    return await axios
      .get(`http://localhost:5000/users?q=${value}`)
      .then((response) => {
        console.log("inside search..",JSON.stringify(response.data));
        setData(response.data);
        setValue("");
      })
      .catch((err) => console.log(err));
  };

  console.log("Data" + data);
  return (
    <MDBContainer>
      <form
        style={{
          margin: "auto",
          padding: "15px",
          maxWidth: "400px",
          alignContent: "center"
        }}
        className="d-flex input-group w-auto"
        onSubmit={handleSearch}
      >
        <input
          type="text"
          className='form-control'
          placeholder='search name..'
          value={value}
          onChange={(e) => setValue(e.target.value)}
        />
        <MDBBtn type="submit" color='dark'>Search</MDBBtn>
        <MDBBtn className='mx-2' color="info" onClick={() => handleReset()}>Reset</MDBBtn>

      </form>
      <div style={{ marginTop: "100px" }}>
        <h2 className='text-center'>search, filter, sort and pagination using JSON fake rest API</h2>
        <MDBRow>
          <MDBCol size="12px">
            <MDBTable>
              <MDBTableHead dark>
                <tr>
                  <th>no</th>
                  <th>name</th>
                  <th>email</th>
                  <th>phone</th>
                  <th>address</th>
                  <th>id</th>
                  <th>status</th>
                </tr>
              </MDBTableHead>
              {data.length === 0 ? (
                <MDBModalBody className='align-center mb-0'>
                  <tr>
                    <td colSpan={8} className='text center mb-0'> No data Found!! </td>
                  </tr>
                </MDBModalBody>
              ) : (
                data.map((item, index) =>
                (
                  <MDBTableBody key={index}>
                    <tr>
                      <th scope='row'>{index + 1}</th>
                      <td>{item.name}</td>
                      <td>{item.email}</td>
                      <td>{item.phone}</td>
                      <td>{item.address}</td>
                      <td>{item.id}</td>
                      <td>{item.status}</td>
                    </tr>
                  </MDBTableBody>
                ))
              )};
            </MDBTable>
          </MDBCol>
        </MDBRow>
      </div>
    </MDBContainer>
  );
}

export default App;
